class Solution():

    def findShortestCycle(self, n: int, edges: List[List[int]]) -> int:
        '\n    There is a bi-directional graph with n vertices, where each vertex is labeled from 0 to n - 1. The edges in the graph are represented by a given 2D integer array edges, where edges[i] = [ui, vi] denotes an edge between vertex ui and vertex vi. Every vertex pair is connected by at most one edge, and no vertex has an edge to itself.\n    Return the length of the shortest cycle in the graph. If no cycle exists, return -1.\n    A cycle is a path that starts and ends at the same node, and each edge in the path is used only once.\n    '
        from collections import defaultdict
        graph = defaultdict(list)
        for (u, v) in edges:
            graph[u].append(v)
            graph[v].append(u)

        def dfs(node, parent, visited, depth):
            visited[node] = True
            for neighbor in graph[node]:
                if (neighbor == parent):
                    continue
                if visited[neighbor]:
                    return depth
                cycle_depth = dfs(neighbor, node, visited, (depth + 1))
                if (cycle_depth != (- 1)):
                    return cycle_depth
            return (- 1)
        shortest_cycle = float('inf')
        for node in range(n):
            visited = ([False] * n)
            cycle_depth = dfs(node, (- 1), visited, 0)
            if (cycle_depth != (- 1)):
                shortest_cycle = min(shortest_cycle, cycle_depth)
        return (shortest_cycle if (shortest_cycle != float('inf')) else (- 1))

class Solution():

    def findMinimumTime(self, tasks: List[List[int]]) -> int:
        '\n    There is a computer that can run an unlimited number of tasks at the same time. You are given a 2D integer array tasks where tasks[i] = [starti, endi, durationi] indicates that the ith task should run for a total of durationi seconds (not necessarily continuous) within the inclusive time range [starti, endi].\n    You may turn on the computer only when it needs to run a task. You can also turn it off if it is idle.\n    Return the minimum time during which the computer should be turned on to complete all tasks.\n    '
        from typing import List
        start_times = [task[0] for task in tasks]
        end_times = [task[1] for task in tasks]
        max_end_time = max(end_times)
        time_intervals = ([0] * (max_end_time + 1))
        for task in tasks:
            (start, end, duration) = task
            for i in range(start, (end + 1)):
                time_intervals[i] += duration
        return max(time_intervals)

class Solution():

    def rootCount(self, edges: List[List[int]], guesses: List[List[int]], k: int) -> int:
        "\n    Alice has an undirected tree with n nodes labeled from 0 to n - 1. The tree is represented as a 2D integer array edges of length n - 1 where edges[i] = [ai, bi] indicates that there is an edge between nodes ai and bi in the tree.\n    Alice wants Bob to find the root of the tree. She allows Bob to make several guesses about her tree. In one guess, he does the following:\n    Chooses two distinct integers u and v such that there exists an edge [u, v] in the tree.\n    He tells Alice that u is the parent of v in the tree.\n    Bob's guesses are represented by a 2D integer array guesses where guesses[j] = [uj, vj] indicates Bob guessed uj to be the parent of vj.\n    Alice being lazy, does not reply to each of Bob's guesses, but just says that at least k of his guesses are true.\n    Given the 2D integer arrays edges, guesses and the integer k, return the number of possible nodes that can be the root of Alice's tree. If there is no such tree, return 0.\n    "
        from typing import List
        n = (len(edges) + 1)
        adj = [[] for _ in range(n)]
        for (u, v) in edges:
            adj[u].append(v)
            adj[v].append(u)
        parent = ([(- 1)] * n)
        for (u, v) in guesses:
            parent[v] = u
        cnt = ([0] * n)
        for v in range(n):
            if (parent[v] != (- 1)):
                cnt[parent[v]] += 1
        leaves = [u for u in range(n) if (not adj[u])]
        q = [u for u in range(n) if (cnt[u] < k)]
        while q:
            u = q.pop()
            for v in adj[u]:
                cnt[v] += 1
                if (cnt[v] == k):
                    q.append(v)
        res = [u for u in range(n) if (cnt[u] >= k)]
        for u in leaves:
            if (cnt[u] >= k):
                res.append(u)
        return (len(res) if res else 0)

class Solution():

    def waysToReachTarget(self, target: int, types: List[List[int]]) -> int:
        '\n    There is a test that has n types of questions. You are given an integer target and a 0-indexed 2D integer array types where types[i] = [counti, marksi] indicates that there are counti questions of the ith type, and each one of them is worth marksi points.\n    Return the number of ways you can earn exactly target points in the exam. Since the answer may be too large, return it modulo 109 + 7.\n    Note that questions of the same type are indistinguishable.\n    For example, if there are 3 questions of the same type, then solving the 1st and 2nd questions is the same as solving the 1st and 3rd questions, or the 2nd and 3rd questions.\n    '
        from typing import List
        MOD = ((10 ** 9) + 7)
        dp = ([0] * (target + 1))
        dp[0] = 1
        for (count, marks) in types:
            for i in range(target, (marks - 1), (- 1)):
                for j in range(1, (count + 1)):
                    if ((i - (j * marks)) >= 0):
                        dp[i] = ((dp[i] + dp[(i - (j * marks))]) % MOD)
        return dp[target]

