class Solution():

    def minCost(self, nums: List[int], k: int) -> int:
        '\n    You are given an integer array nums and an integer k.\n    Split the array into some number of non-empty subarrays. The cost of a split is the sum of the importance value of each subarray in the split.\n    Let trimmed(subarray) be the version of the subarray where all numbers which appear only once are removed.\n    For example, trimmed([3,1,2,4,3,4]) = [3,4,3,4].\n    The importance value of a subarray is k + trimmed(subarray).length.\n    For example, if a subarray is [1,2,3,3,3,4,4], then trimmed([1,2,3,3,3,4,4]) = [3,3,3,4,4].The importance value of this subarray will be k + 5.\n    Return the minimum possible cost of a split of nums.\n    A subarray is a contiguous non-empty sequence of elements within an array.\n    '
        from collections import Counter

        def trimmed(arr):
            return [num for num in arr if (count[num] > 1)]
        count = Counter(nums)
        n = len(nums)
        dp = ([float('inf')] * (n + 1))
        dp[0] = 0
        for i in range(1, (n + 1)):
